def pred(val):
    coeffs = [-0.0000002226, 0.00000370629, 0.959373]
    return poly_coeff(val, coeffs)


def poly_coeff(x, coeffs):
    y = 0
    y += coeffs[0]*x**4
    y += coeffs[1]*x**3
    y += coeffs[2]*x**1
    return y


