def slice(im, starty, startx, endy, endx):
    grey = cv2.cvtColor(im, cv2.COLOR_BGR2GRAY)
    grey = grey[startx:endx, starty:endy]
    return grey


def read_number(img):
    # -c tessedit_char_whitelist=0123456789.
    cc = f'--psm 7 --oem 3 -c tessedit_char_whitelist=0123456789.WRPMkm/'
    text = pytesseract.image_to_string(
        img, lang='eng', config=cc).replace('\n', '')
    return text


def get_decision(vel, wat, rpm):
    if rpm == 0:
        return 0
    # get theoretical gear
    gear = speed_cad_to_gear(vel, rpm)
    print(f'theoretical gear = {gear}')
    with open('/Users/tarioyou/biking/isef_bike/output.txt', 'a') as f:
        f.write(f'theoretical gear = {gear}\n')

    # get closest matching gear
    gear = min(enumerate(ratios), key=lambda x: abs(x[1]-gear))[1]

    if gear == -1:
        return 0

    gear_index = ratios.index(gear)

    if gear != ratios[-1]:
        rpm_next = rpm * ratios[gear_index + 1] / gear
        if abs(gear * pred(rpm) - ratios[gear_index + 1] * pred(rpm_next)) < torque_moe:
            # torques same, so might as well go up
            return 1
        if rpm >= rpm_opt:
            # redline
            return 1

    if gear != ratios[0]:
        rpm_prev = rpm * ratios[gear_index - 1] / gear
        if rpm_prev < rpm_max:
            # switch down wont make rpm too high
            return -1

    return 0


def speed_cad_to_gear(vel, rpm):
    if rpm == 0:
        return -1
    return vel / wheel_circumference / 60 / rpm


